import React from 'react';
import {
    Route,
    Switch
} from "react-router-dom";
import { StyledBody } from './Styled';
import Auth from '../../components/auth/Auth';
import Menu from 'src/App/components/menu/Menu';
import Cart from 'src/App/components/cart/Cart';
import Home from 'src/App/components/home/Home';

const routes = [
    {
        path: '/menu',
        component: Menu
    },
    {
        path: '/home',
        component: Home,
    },
    {
        path: '/cart',
        component: Cart,
    },
    {
        path: '/auth',
        component: Auth,
    }
]

const Body = () => {
    return (
        <Route path="/:page">
            <StyledBody>
                <Switch>
                    {routes.map((route, index) => {
                        return <Route key={index} path={`${route.path}`}>
                            <route.component />
                        </Route>
                    })}
                </Switch>
            </StyledBody>
        </Route>
    )
}

export default Body;
